export default function SelectedCards({ selectedCards, handleCardRemove }) {
  return selectedCards.map((selectedCard, i) => {
    if (selectedCard) {
      return (
        <div className="SelectedCardsGrid Card-Box">
          <div
            key={selectedCard.name + i}
            onClick={() => {
              handleCardRemove(i);
            }}
          >
            <img className="Card-Image" src={selectedCard.picture}></img>
            <p>{selectedCard.name}</p>
          </div>
        </div>
      );
    }
    return (
      <div className="SelectedCardsGrid">
        <div key={i}>Empty</div>
      </div>
    );
  });
}
